import React from 'react';

const API_ID = "codingbootcamp";

class Events extends React.Component{
    state = {
        events: []
    }
    componentDidMount = async() =>{
        const title = this.props.location.state.artist;
        const req = await fetch
        (`https://rest.bandsintown.com/artists/${title}/events/?app_id=${API_ID}`); 
        const res = await req.json();
        // console.log(res);
        this.setState({events: res})
        // console.log(this.state.events[0].venue.country);


    }




    render(){
        const event = this.state.events;
        console.log(event);
        console.log("Length: " + event.length);
        console.log(event[0].venue.country);
        return (

            <div>
                <p>EVENTS DETAILS</p>
                <p>{event[0].venue.country}</p>

            </div>

        );

    }

}

export default Events;
